package com.orgs;

public class Operator_Logical {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a= 7;
		int b= 34;
		int c=9;
		int d=23;
		int e=7;
		int f=17;
		int g=15;
		
		System.out.println((a>b)&&(c<b));
		System.out.println((f>e)&&(b>c));
		System.out.println((d>b)&&(g<d));
		System.out.println((a>b)||(c<b));
		System.out.println((f>e)||(g<e));
		
	}

}
